import React from 'react';
import './Cards.css';
import CardItem from './CardItem';
import img1 from './images/image7.jpg';
import img2 from './images/image1.jpeg';
import img3 from './image5.png';
function Cards() {
  return (
    <div>
      <CardItem
        imagesrc='sugar-wise\src\Components\images\image7.jpg'
        title="Beautiful Sunset"
        text="A vibrant sunset captured over the ocean."
      />
    </div>
  );
}

export default Cards;
